class CircularNode {
  CircularNode(next, prev, i){
    this.next = next;
    this.prev = prev;
    this.i = i;
  }

  addTail(head ,i){
    let ptr = head;
    // get to the current tail
    while( ptr.next != null){
      ptr = ptr.next;
    }
    // create the new tail
    tail = new CircularNode(head,ptr,i);
    // set heads prev
    head.prev = tail;
  }

  addNext(curr, i){
    ptr = new CircularNode(null, curr, i);
    curr.next = ptr;
  }

  printList(head){
    ptr = head;
    console.log(ptr.i);
    ptr = ptr.next;
    while( ptr != head){
      console.log(ptr.i);
      ptr = ptr.next;
    }
  }
}
